window.bookSummaryJSON = "<p>From <i>USA Today</i> best-selling author W Winters comes an emotionally captivating and thrilling, romantic suspense audiobook. </p> <p>Her lips tasted like Cabernet and her touch was like fire. </p> <p>I was blinded by what she did to me. I so easily fell for something I thought I’d never have. </p> <p>I was weak for her and should’ve known better. I should’ve known she could never love a man like me. </p> <p>She brought out a side of me that I wish had stayed dead. </p> <p>I won’t make the same mistake twice. </p> <p>I don’t care how much she begs me. </p> <p>I don’t care that I crave her more than anything else.</p>"; 
